import { WebView } from 'react-native-webview';



const App = () => (
  <SafeAreaView style={styles.container}>
    <AreaPdf />
    <View >
      <View>
        <View style={styles.fixToText}>
          <Button
            title="anterior"
            color='black'
            borderRadius='10'
            padding='10px'
            onPress={() => Alert.alert('anterior')}
          />

          <Button style={styles.fixToText2}
            title="1"
            color='black'
            borderRadius='10'
            justifyContent='center'

            onPress={() => Alert.alert('Proximo')}
          />


          <Button
            title="Proximo"
            color='black'
            borderRadius='10'
            padding='10px'
            onPress={() => Alert.alert('Proximo')}
          />
        </View>
      </View>
    </View>
  </SafeAreaView>
);

const AreaPdf = () => {
  return (
    <View style={styles.container}>
      <View style={styles.box} />
      <PDF style={styles.container} />
    </View>

  );
}

const PDF = () => {


  return <View style={styles.fundo}><View>
       <iframe src="https://drive.google.com/file/d/10V7DiWJqyWN2VxbTonpy7uk2r0zjMX3m/preview"></iframe>




  </View>
  </View>
}

const Separator = () => (
  <View style={styles.separator} />
);









